import React from 'react';
import './Footer.css';

const Footer = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const footerSections = {
    services: [
      { name: 'Fullstack Prototyping', onClick: () => scrollToSection('services') },
      { name: 'Strategic Consulting', onClick: () => scrollToSection('services') },
      { name: 'Workforce Education', onClick: () => scrollToSection('services') },
      { name: 'Architecture Design', onClick: () => scrollToSection('services') }
    ],
    company: [
      { name: 'About Us', onClick: () => scrollToSection('about') },
      { name: 'Contact', onClick: () => scrollToSection('contact') },
      { name: 'Careers', href: '#' },
      { name: 'Blog', href: '#' }
    ]
  };

  const socialLinks = [
    { icon: 'fab fa-linkedin', href: '#', label: 'LinkedIn' },
    { icon: 'fab fa-twitter', href: '#', label: 'Twitter' },
    { icon: 'fab fa-github', href: '#', label: 'GitHub' }
  ];

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <div className="footer-section">
            <div className="footer-logo">
              <i className="fas fa-seedling"></i>
              <span>Cactus Labs AI</span>
            </div>
            <p>Empowering businesses with AI-driven solutions for the future.</p>
            <div className="social-links">
              {socialLinks.map((link, index) => (
                <a 
                  key={index}
                  href={link.href}
                  aria-label={link.label}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <i className={link.icon}></i>
                </a>
              ))}
            </div>
          </div>

          <div className="footer-section">
            <h4>Services</h4>
            <ul>
              {footerSections.services.map((service, index) => (
                <li key={index}>
                  <button onClick={service.onClick}>
                    {service.name}
                  </button>
                </li>
              ))}
            </ul>
          </div>

          <div className="footer-section">
            <h4>Company</h4>
            <ul>
              {footerSections.company.map((item, index) => (
                <li key={index}>
                  {item.onClick ? (
                    <button onClick={item.onClick}>
                      {item.name}
                    </button>
                  ) : (
                    <a href={item.href}>{item.name}</a>
                  )}
                </li>
              ))}
            </ul>
          </div>
        </div>

        <div className="footer-bottom">
          <p>&copy; 2024 Cactus Labs AI. All rights reserved.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
